  return (
    <IonPage>
      <Navbar />
        <div id="tabs" style={{textAlign:'center', margin:'0px'}}>
          <IonButton fill='clear' onClick={() =>{setpage(1)}} className='tabBtn'>Annoucements</IonButton>
