          <IonButton fill='clear' onClick={() =>{setpage(3)}} className='tabBtn'>Discussions</IonButton>
        </div>
        <IonContent className='tabInfo mb-5'>
          {page == 1 && <Annoce />}
          {page == 2 && <Devotions />}
        </IonContent>
    </IonPage>
  );
};

export default SubscriptionTabs;
